import React from "react";
import {bool, func} from 'prop-types';
import {LinkOrganism} from '../organisms';
import ModalWithGradientTemplate from "../templates/ModalWithGradientTemplate";

const MenuModal = ({handleRedirectToPage, handleOpenMenuModal}) => {
  return(
    <ModalWithGradientTemplate 
      handleOpenMenuModal={handleOpenMenuModal} 
      isFooterShow={false}
    >
      <LinkOrganism handleRedirectToPage={handleRedirectToPage}/>
    </ModalWithGradientTemplate>
  )
}

MenuModal.propTypes = {
  handleRedirectToPage: func,
  handleOpenMenuModal: func,
  isFooterShow: bool,
}

export default MenuModal;
